  \"nist-backscattering-correction-factor-database-for-auger-electron-spectroscopy-srd-154\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"This database provides values of backscattering
  correction factors (BCF) of homogeneous materials for quantitative surface analyses
  by Auger electron spectroscopy. These BCFs are obtained from Monte Carlo simulations
  based on two models of electron transport in the material, a simplified model and
  an advanced model. One assumption for the former model is that the primary-electron
  beam is unchanged, in intensity, energy or direction, within the information depth
  for Auger-electron emission. This assumption becomes progressively less useful as
  the primary energy becomes closer to the core-level ionization energy for the relevant
  Auger transition or for increasing angles of incidence of the primary electrons.\",\n\t\"license_title\":
